import './Movie.css'

export default function Movie(){
    return(
        <div>
            <nav className="nav">
                <NavLink className="li">Home</NavLink>
                <NavLink className="li">Movies</NavLink>
                <NavLink className="li">Contact me</NavLink>
                <NavLink className="li">About</NavLink>
            </nav>
        </div>
    );
}
